import { stats } from "../constants";
import styles from "../style";

const Stats = () => {
  return (
    <section
      className={`${styles.flexCenter} flex flex-row flex-wrap sm:mb-20 mb-6`}>
      {stats.map((stats) => (
        <div key={stats.id} className="text-white">
          <h4>{stats.value}</h4>
          <p>{stats.title}</p>
        </div>
      ))}
    </section>
  );
};

export default Stats;
